- input: "TEXT\x1CC00041269\x1CX2\x1CC6026237\x1CSA15\x1CIn February 2009 the Committee
    incurred a charge on its Visa Card account for Inaugural Event Activity at the
    Hyatt Hotel in WDC. Shortly after the charges were made the credit card account
    was closed by the bank due to possible fraudulent activity, and a new card/account
    was issued to the Committee. In July of 2010, the bank applied a credit that was
    received from the Hyatt Hotel for the Inaugural event to the new credit card account
    that was supposed to be applied to the old account that had been closed. However,
    the bank did not notify the Committee of this credit payment against the new account.
    This transaction seeks to clarify for the public record the receipt of the refund
    from Hyatt, the subsequent payment applied to the card balance, and the series
    of credit card charges that were affected by this credit. Please see Schedule
    B for Line number 21b.\n"
